import React from "react";

function Note(props) {
    function deleteClick() {
        props.deleteItem(props.id);
    }

    return (
        <div className="note">
            <h1>{props.title}</h1>
            <p>{props.content}</p>
            <button onClick={deleteClick}>DELETE</button>
        </div>
    );
}

export default Note;
